import { List, Item, Text } from './ListContact.styled';

export const ListContact = ({ filter, onDeleteContact }) => {
  return (
    <div>
      <List>
        {filter.map(item => (
          <Item key={item.id}>
            <Text>
              {item.name} : {item.number}
            </Text>
            <button type="button" onClick={() => onDeleteContact(item.id)}>
              Delet contact
            </button>
          </Item>
        ))}
      </List>
    </div>
  );
};
